import React from 'react';
import { Provider } from 'react-redux';

import 'bootstrap/dist/css/bootstrap.min.css';
import './App.scss';
import './layout.scss';

import store from "./store";

//components 
import Search from "./components/search/search.js"
import { Container, Row, Col } from 'react-bootstrap';

function App() {
  return (
      <div className="app">
          <Provider store={store}>
            <Container className="layout">
              <Row>
                <Col lg="5" xs="5" style={{background:'red'}}>A</Col>
                <Col lg="2" xs="2" style={{background:'white'}}>B</Col>
                <Col lg="5" xs="5" style={{background:'blue'}}>C</Col>
              </Row>
              <Row>
                <Col>
                  <Search/>
                </Col>
              </Row>
            </Container>
         </Provider>
      </div>

  );
}

export default App;
